@Pontifex @Israel @GovtofPakistan the Lord Havaya says this:
“I am the one who sees.
There shall never again be war,
Such as this war. 
Fire shall light up the skies;
Like a voice from a cistern.
Lands they shall lay desolate;
Their cities they shall flee...

